import React from 'react'

function Product(props)
{
    return(
        <div>
          <img src={props.productImage}></img>
          <h1>{props.title}</h1>
          <h4>{props.description}</h4>
          <h5>{props.price}</h5>
          <h6>{props.associatedUsername}</h6>
          <a><button></button></a>
        </div>
    );
}

export default Product;
